caption:
Designing for @conniecyntia felt like gathering warm golden light and watching it slowly turn into lace, and honestly that’s the closest way we can describe her presence. 💫🤗✨

She walks in and the room just feels warmer, brighter, a little happier. She’s so sweet in this comforting, natural kind of softness, bubbly in a way that lifts everyone’s mood, playful with a charm that definitely makes you giggle back, and still so beautifully feminine and elegant without even trying. 🤍🌤️

So we created a mermaid dress that hugs her the way her energy fills a space. A sheer boned bodice to give that soft, romantic structure that feels very her. The gown is crafted from textured lace, giving the whole look a soft, artful dimension. Long lace sleeves to frame her gentle sweetness, and a veil with a sacred, ethereal prettiness that only Connie can pull off so effortlessly. 🪄🦢

PS. everything looks so pretty we literally can’t pick a favorite 💛📸 (@karsa.co & @georgejkristian)

